import { Link } from 'react-router-dom';
import Nav from './Nav';
import '../styles/SignIn.css';

const SignIn = (props) => {
    console.log(props, 'signin');
    const { setHideSignIn, submitHandSignIn } = props;

    setHideSignIn(true);
    return (
        <div>
            <Nav hideSignIn={props.hideSignIn} />
            <div className='signin'>
                <form onSubmit={(e) => submitHandSignIn(e)}>
                    Sign In
                    <input placeholder='Email or Phone Number'></input>
                    <input type='password' minLength='8' placeholder='Password'></input>
                    <input type='submit' value='Sign In'></input>
                </form>
                <div>
                    New to Netflix? <div>Sign up now</div>
                </div>
            </div >
        </div>
    )
}

export default SignIn;
